import React from 'react'
import Today from './Today/Today'
import './Main.scss'
import {
    Switch,
    Route,
} from "react-router-dom";

function Main()  {
    return (
        <div className='Main'>
            <Switch>
                <Route path='/today'>
                    <Today />
                </Route>
            </Switch>
        </div>
    )
}

export default Main
